import React, {Component, useState } from 'react'
import Figure from 'react-bootstrap/Figure';
import Container from 'react-bootstrap/Container';
import 'bootstrap/dist/css/bootstrap.min.css';


export default function TestImageHook() {


    return (

        <Container>

            <h3>Demonstracja wstawiania obrazka z pliku (HOOK).</h3>

            <Figure>
                <Figure.Image
                    width={200}
                    height={300}
                    src="./images/logo.png"

                />
                <Figure.Caption>
                    To jest logo React-a
                </Figure.Caption>
            </Figure>

        </Container>
    );

}
